import React from "react";

function SideMenu() {

    const filterContent= (event) => {
        console.log(event.target.value)
    }
    return (
        <div class="sidebar" id="sidenav">
            <div id="leftmenu">
                <div id="leftmenuinner">
                <input class="searchinput" placeholder="Search..." onInput={filterContent}/>
                <ul>Menu</ul>
                <li><a href="">DIY & house decor</a></li>
                <li><a href="">Cocktails</a></li>
                <li><a href="">Music</a></li>
                <li><a href="">Kids stuff</a></li>
                </div>
            </div>
        </div>
    )
}

export default SideMenu;
